import React from "react";

const currentYear = new Date().getFullYear();

const Footer = () => {
    return (
        <footer className='footer'>
            <div>Powered by TMDB</div>
            <div>Copyright Goran Spasojevic {currentYear}</div>
        </footer>
    );
}

export default Footer;
